script: |
  super -f text -I q193.spq | sort > q193.out

inputs:
  - name: q193.spq
    data: |
      SELECT DISTINCT - 75 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q193.out
    data: |
      -75
